import { OAuthCredential } from "firebase/auth";

export enum UserType{
    USER='user',
    MODERATOR='moderator',
    DJ='dj'
}

export default interface User{
    display_name:string;
    email:string;
    photo_url:string;
    uid:string;
    user_type:UserType
    token:string;
    credential:OAuthCredential | null
}
